import React from "react";
import ReactDOM from 'react-dom';
import './index.css'
import App from './App';
import state, {StateType} from "./redux/state";

const rerenderEntireTree = (state:StateType) => {
    ReactDOM.render(
        <React.StrictMode>
        <App/>
        </React.StrictMode>,
        document.getElementById('')
    );
}

rerenderEntireTree(state);
